import React from "react";

import { FaUserAlt } from "react-icons/fa";
import { IoLocationSharp } from "react-icons/io5";

export default function CalendarItem(props) {
  return (
    <div
      className={
        "absolute bg-" +
        props.color +
        "-300 border-l-2 border-" +
        props.color +
        "-600 text-" +
        props.color +
        "-600"
      }
    >
      <h3>{props.title}</h3>
      <h4>
        <span>
          <FaUserAlt />
          {props.professor}
        </span>
      </h4>
      <h4>
        <span>
          <IoLocationSharp />
          {props.location}
        </span>
      </h4>
    </div>
  );
}
